import axios from "axios";
import { set } from "mongoose";
import { useEffect, useState } from "react";

const KitchenService = () => {
  const [display, setDisplay] = useState([]);
  useEffect(() => {
    axios
      .get("http://localhost:8081/fetchFromDataBase")
      .then((display) => setDisplay(display.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      {
        <tr>
          <th>
            <span style={{ margin: "15px" }}> </span>
          </th>
          <th>
            <span style={{ margin: "15px" }}>Order</span>
          </th>
          <th>
            <span style={{ margin: "15px" }}>Quantity</span>
          </th>
        </tr>
      }
      {display.map((item) => {
        return (
          <>
            <table
              border={"1px solid black"}
              style={{
                "border-collapse": "collapse",
                width: "45%",
                height: "0%",
              }}
            >
              <tr>
                <td>
                  <input
                    type="checkbox"
                    style={{ "margin-left": "10px", width: "10px" }}
                  ></input>
                </td>
                <td>
                  <span style={{ "margin-left": "5px", width: "px" }}>
                    {item.name}
                  </span>
                </td>
                <td>
                  <span style={{ margin: "5px", width: "20px" }}>
                    {" "}
                    {item.quantity}
                  </span>
                </td>
                <td>
                  <button>Confirm</button>
                </td>
              </tr>
            </table>
          </>
        );
      })}
    </div>
  );
};

export default KitchenService;
